import GoogleMapReact from 'google-map-react';

export default function Map({ center, zoom }) {
    return (
        <div className='map'>
            <GoogleMapReact
                bootstrapURLKeys={{ key:'AIzaSyCHi3ZaSAQC-xTOjem1D3yBSqRXqdEvi_c' }}
                defaultCenter={center}
                defaultZoom={zoom}
            >

            </GoogleMapReact>
        </div>
    )
}

Map.defaultprops = {
    center: {
        lat: 42.3265,
        lng: -122.8756,
    },
    zoom: 6
}
